  [],\n\t\"revision_timestamp\": \"2015-05-06T21:09:36.816259\",\n\t\"name\": \"novel-membrane-for-highly-efficient-fuel-cells-project\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"Proton Exchange Membrane (PEM) fuel cells
  and electrolyzers are key technologies for NASA space systems utilizing hydrogen,
  oxygen, or water as reactants. In order to improve the life and reliability of the
  electrochemical stacks within these systems, as well as to reduce overall system
  mass/volume and cost, development of membrane-electrode-assemblies (MEAs) that are
  stable and highly efficient is critical. Currently, the state-of-the-art membranes
  used in fuel cell systems are perfluorocarbon sulfonate based materials such as
  Nafion&lt;SUP&gt;REG&lt;/SUP&gt; which show excellent stability and conductivity
  under hydrated condition at low temperature (T &amp;#8804; 80&amp;#730;C). However,
  higher operating temperatures (T &gt; 130&amp;#730;C) would provide several advantages
  for fuel cell operation. Advantages include higher operating currents, improved
  CO tolerance, simpler and more efficient heat management, simpler water management
  and potential use of non-platinum catalysts. In this program, EIC Laboratories will
  develop novel PEM membranes that are insensitive to hydration for use at elevated
  temperatures and which can be synthesized inexpensively in bulk.\",\n\t\"license_title\":
